{
  "name": "nexmoe",
  "scripts": {
    "dev": "pnpm run --filter=demo dev",
    "dev:docs": "pnpm run --filter=docs dev",
    "build:demo": "pnpm run --filter=demo build"
  },
  "engines": {
    "node": ">=18",
    "pnpm": ">=8"
  }
}

